var title_f41_3_42043="Blood replacement products";
var content_f41_3_42043=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F53854&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F53854&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Blood replacement products: Recommended uses and effects in adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"20%\">",
"     </colgroup>",
"     <colgroup width=\"60%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Product (mL)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Contents",
"       </td>",
"       <td class=\"subtitle1\">",
"        Uses and effects",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Whole blood (1 unit = 500 mL)",
"       </td>",
"       <td>",
"        All components",
"       </td>",
"       <td>",
"        Rarely required. Consider when massive bleeding requires transfusion of &gt;5 to 7 units of packed red cells.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Red cells + additive solution (1 unit = 350 mL)",
"       </td>",
"       <td>",
"        Red cells",
"       </td>",
"       <td>",
"        One unit increases hematocrit by 3 percentage points and hemoglobin by 1 g/dL.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Frozen plasma (1 unit = 200 to 300 mL)",
"       </td>",
"       <td>",
"        All clotting factors, but no platelets",
"       </td>",
"       <td>",
"        Best used to correct deficiencies of multiple coagulation factors (eg, DIC, liver disease, warfarin overdosage). One unit FFP increases fibrinogen by 7 to 10 mg/dL. Usual dose is 10 to 15 mL/kg.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cryoprecipitate (1 unit = 10 to 20 mL)",
"       </td>",
"       <td>",
"        Fibrinogen, factors VIII, XIII, VWF",
"       </td>",
"       <td>",
"        Typical dose consists of two bags of prepooled cryoprecipitate (total of 10 units), which will raise plasma fibrinogen by 70 mg/dL in a 70 kg recipient.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Whole blood-derived and apheresis-derived platelets (1 unit = 50 mL)",
"       </td>",
"       <td>",
"        Platelets",
"       </td>",
"       <td>",
"        Six units of whole blood-derived or one unit of apheresis-derived platelets will raise the platelet count by approximately 30,000/microL in an average sized adult.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Frozen blood products (plasma, cryoprecipitate) take 35 to 45 minutes to thaw. It may take the same amount of time to perform an uncomplicated crossmatch.",
"    <div class=\"footnotes\">",
"     DIC: disseminated intravascular coagulation; FFP: fresh frozen plasma; VWF: von Willebrand Factor; kg: kilograms.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
