var title_f41_3_42044="Skin tumors after OLT";
var content_f41_3_42044=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F72557&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F72557&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Skin tumors after liver transplantation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Tumor",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Squamous cell and basal cell carcinomas",
"       </td>",
"       <td>",
"        Squamous cell carcinomas are more frequent than basal cell carcinomas, in contrast to the non-transplantation context where basal cell carcinomas are 5 times more frequent than squamous cell. The risk increases with the length of the immunosuppression. After 15 years, they can be found in more than 50 percent of the recipients of a liver transplantation, particularly in regions exposed to sunlight. Regular use of sunscreens may prevent the development of squamous cell carcinoma and to a lesser degree basal cell carcinoma [1]. The use of topical diclofenac 3 percent&nbsp;gel may improve post-liver transplantation actinic keratosis and decrease the risk of squamous cell carcinoma [2]. These cancers are also frequent in the anogenital region where they may indicate the presence of another pathogen, human papilloma virus. They are often multiple and aggressive with rapid recurrence after excision, early metastases, or coexistence with a sarcomatous component.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cutaneous lymphomas",
"       </td>",
"       <td>",
"        Primary lymphomas of the skin are rare after liver transplantation. When present, they appear as nodules and tumors that are necrotic or ulcerative, more often on the face. They typically occur about 3 years after transplantation and are a sign of an infection with Epstein Barr virus and/or strong immunosuppression. T-cell lymphoma/S&eacute;zary syndrome are rare after liver transplantation [3].",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Melanomas",
"       </td>",
"       <td>",
"        Melanomas are 2.5 to 4 times more frequent after liver transplantation than in a non-transplanted population. A history of a melanoma before the transplantation is a risk factor for a subsequent melanoma. Melanomas can appear de novo after transplantation (mean time 5 years after), be a recurrence or, rarely, be transferred by the graft. Remission has been described after kidney transplantation after removal of the graft.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Kaposi's sarcoma",
"       </td>",
"       <td>",
"        The risk of developing a Kaposi's sarcoma after liver transplantation increases 400 to 500 times. The lesions can appear in the first six months following the transplantation. Late presentations are also possible (more than 10 years after transplantation). Infection with herpes virus 8 and the immunosuppression have a pathogenic role. The lesions are limited to the skin in 50 percent of the cases. They appear as violaceous plaques or nodules accompanied by lymphedema. They are most frequently seen on the inferior extremities, but can occur anywhere. They may display Koebner's phenomenon (occur in areas of trauma). The evolution is usually indolent, but fulminant forms have been reported.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Merkel's cell tumors",
"       </td>",
"       <td>",
"        The frequency of these tumors, which have been associated with the Merkel cell polyoma virus, is increased after liver transplantation. The clinical presentation is usually a firm and inflammatory nodule. These tumors can be aggressive with local diffusion, metastasis, and rapid recurrence after excision.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     1.&nbsp; Ulrich C, Jurgensen JS, Degan A, et al. Prevention of non-melanoma skin cancer in organ transplant patients by regular use of a sunscreen: a 24 months, prospective, case-control study. Br J Dermatol 2009; 161 Suppl 3:78.",
"     <br>",
"      2. Ulrich C, Johannsen A, Rowert-Huber J, et al. Results of a randomized, placebo-controlled safety and efficacy study of topical diclofenac 3% gel in organ transplant patients with multiple actinic keratoses. Eur J Dermatol 2010; 20:482.",
"      <br>",
"       3. Al Ajroush N, Rafique Sheikh K, Kadry R, et al. T-cell lymphoma/S&eacute;zary syndrome in a liver transplant recipient. J Cutan Med Surg 2012; 16:68.",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f41_3_42044=[""].join("\n");
