var title_f41_3_42045="Stimulation tests for adrenal insufficiency";
var content_f41_3_42045=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F53669&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F53669&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Stimulation tests for adrenal insufficiency: Protocols and normal blood and urinary steroid hormone levels",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Adrenal capacity (ACTH stimulation tests)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Rapid IV ACTH test*:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        <p>",
"         Intravenous Cortrosyn:&nbsp;15 micrograms/kg in neonates, 125 micrograms up to 2 years, 250 micrograms over 2 years of age. Dose is infused IV over one minute.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Sample blood for serum cortisol and ACTH at baseline and for cortisol at one hour after infusion.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Normal response: Serum cortisol at 1 hour is 7 to 10 micrograms/dL over baseline level and &gt;18 micrograms/dL.",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Prolonged ACTH test*: The response can either be measured as a change in urinary steroid concentrations or a change in serum cortisol levels.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Prior to starting ACTH, obtain baseline (8:00 AM) ACTH and cortisol levels,&nbsp;or obtain two consecutive days of 24 hour urine collections for 17-hydroxycorticosteroids (17OHCS) and free cortisol, ending at 8:00 AM on the morning of ACTH administration.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Give 20 U/m",
"        <sup>",
"         2",
"        </sup>",
"        Acthar gel IM every 12 hours for 3 days,&nbsp;or give 250 micrograms/1.73 m",
"        <sup>",
"         2",
"        </sup>",
"        Cortrosyn IV over 8 to 12 hours beginning at 8:00 AM for 3 consecutive days.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Measure serum cortisol at the end of the ACTH treatment (after 3 days of Acthar gel,&nbsp;or once daily for three days at the end of the Cortrosyn infusion). If measuring urinary steroids, continue 24 hour urine collections for 17-OHCS and free cortisol during the three days of ACTH treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Normal responses: Serum cortisol increases to &gt;36 micrograms/dL. Urinary 17-OHCS and free cortisol show a three- to five-fold increase over baseline.",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        ACTH secretory ability",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Insulin-induced hypoglycemia:",
"        <sup>",
"         [1,2]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        After fasting since midnight, the test is performed in the morning. Obtain baseline 8:00 AM serum cortisol and glucose levels.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Give 0.05 units/kg of regular insulin IV, and measure cortisol and glucose levels at 15, 30, 45, and 60 minutes. If desired, samples for growth hormone can be obtained at the same time points to screen for growth hormone deficiency. Blood sugar levels should drop by 50 percent or to &lt;45 mg/dL. If this does not occur by 45 minutes, the dose of insulin can be repeated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Normal response: The cortisol level should increase to twice the baseline level or above 20 micrograms/dL.",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Glucagon stimulation test:",
"        <sup>",
"         [3]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        After fasting since midnight, the test is performed in the morning. Obtain baseline 8:00 AM serum cortisol and glucose.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Give glucagon 0.1 mg/kg IM and obtain blood samples at 15, 30, 45, 60, 90, 120, 150 and 180 minutes for glucose and cortisol levels. If desired, samples for growth hormone measurement can be obtained at the same time points to screen for growth hormone deficiency.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Normal response: The cortisol level normally decreases during the first 60 to 90 minutes, and then reaches a peak of &gt;20 micrograms/dL by 180 minutes. Hypoglycemia is a risk during the second half of the test.",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Single dose Metyrapone Test* (this test should be performed in the hospital):",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Obtain baseline blood sample for ACTH, cortisol, and 11-deoxycortisol levels at 8:00 AM.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Give 30 mg/kg (up to 3.0 g) metyrapone orally at midnight with food.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Obtain blood for ACTH, cortisol and 11-deoxycortisol levels at 8:00 AM the following morning.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Normal response: ACTH level rises to over 100 pg/mL, 11-deoxycortisol rises to &gt;7 micrograms/dL, and cortisol drops to &lt;5 micrograms/dL if there has been adequate suppression of 11-hydroxylase activity.",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Prolonged Metyrapone Test* (this test should be performed in the hospital):",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Obtain baseline blood sample for ACTH, cortisol, and 11-deoxycortisol at 8:00 AM.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Give 15 mg/kg or 300 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        every 4 hours for six doses at 8:00 AM, 12:00 noon, 4:00 PM, 8:00 PM, 12:00 midnight, and 4:00 AM.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Four hours after the last dose, at 8:00 AM, obtain blood for ACTH, cortisol, and 11-deoxycortisol.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Normal response: ACTH level rises to over 100 pg/mL, 11-deoxycortisol rises to &gt;7micrograms/dL, and cortisol drops to &lt;5 micrograms/dL if there has been adequate suppression of 11-hydroxylase activity.",
"        </em>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ACTH: adrenocorticotropic hormone.",
"     <br>",
"      * Normal ranges and protocols are from Esoterix Laboratories, Calabasas Hills, California, and are used with permission.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Donohoue PA. The Adrenal Gland and its Disorders. Kappy MS, Allen DB, Geffner, ME (eds). Principles and Practice of Pediatric Endocrinology, Charles C. Thomas Publisher, Springfield, IL, 2005, p381.",
"       </li>",
"       <li>",
"        Schmidt IL, et al. Diagnosis of adrenal insufficiency: Evaluation of the corticotropin releasing hormone test and basal serum cortisol in comparison to the insulin tolerance test in patients with hypothalamic-pituitary-adrenal disease. J Clin Endocrinol Metab 88:4193, 2003.",
"       </li>",
"       <li>",
"        Vanderschueren-Lodeweyckx M et al. The glucagon stimulation test: Effect on plasma growth hormone and on immunoreactive insulin, cortisol, and glucose in children. J Pediatr 1974;85:182-187.",
"       </li>",
"      </ol>",
"      <p>",
"       &nbsp;",
"      </p>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
